import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <img src="dashboard/src/holberton.jpg"></img>
       <img src="%PUBLIC_URL%/mypic.jpg" />
      </header>
    </div>
  );
}

export default App;
